    'The total number of accounts created is not in itself important information. However, it is beneficial to analyze the number created over time. This will indicate whether or not things are on the right track. You feel me?' => 'Det totale antall kontoer opprettet, er i seg selv ikke viktig informasjon. Imidlertid er det fordelaktig å analysere antall skapt over tid. Dette vil indikere hvorvidt ting er på rett spor.',
