    'A significant increase or decrease in customer registration shows that there has probably been a change to your shop. With that in mind, we suggest that you identify the cause, correct the issue and get back in the business of making money!' => 'En betydelig økning eller reduksjon i kunderegistreringer viser at det trolig har vært en endring i butikken. Dersom trenden er negativ bør du lokalisere årsaken og løse problemet!',
    'Here is a summary of what may affect the creation of customer accounts:' => 'Her er oppsummering av hva som kan påvirke dannelsen av kundenes kontoer:',
