    'Since you may not have downloaded this module from PrestaShop Addons, we cannot assert that the module is not adding some undisclosed functionalities. We advise you to install it only if you trust the source of the content.' => 'Siden du kanskje ikke har lastet ned denne modulen fra PrestaShop Addons kan vi ikke garantere at denne modulen ikke legger til ukjent funksjonalitet. Du bør bare installere denne modulen dersom du stoler på kilden den kommer fra.',
