    'A module that hasn\'t been verified may be dangerous and could add hidden functionalities like backdoors, ads, hidden links, spam, etc. Don’t worry, this alert is simply a warning.' => 'En modul som ikke er verifisert kan være farlig og kan legge til skjult funksjonalitet som bakdører, reklame, skjulte lenker, spam, etc. Ikke bekymre deg, denne meldingen er bare en advarsel.',
